import React, { useState } from 'react';

import OrgForm from './OrgForm.js';
import SupplyForm from './SupplyForm.js';


export default function AddSupply(){
    const [step, nextStep] = useState(1);
    switch(step){
        case 1:
            return <OrgForm/>;
        case 2:
            return <SupplyForm/>
        default:
            return null;
    }
}
